import React from "react";
import IndexNavbar from "components/Navbars/IndexNavbar.js";
import Footerr from "components/Footers/Footerr";

function MyTickets() {
  const tickets = [
    {
      id: 1,
      sujet: "Connexion VPN bloqu√©e",
      departement: "IT",
      statut: "Ouvert",
      date: "2025-04-04",
    },
    {
      id: 2,
      sujet: "Erreur sur fiche de paie",
      departement: "RH",
      statut: "En cours",
      date: "2025-04-01",
    },
    {
      id: 3,
      sujet: "Probl√®me d'acc√®s √† l'intranet",
      departement: "IT",
      statut: "R√©solu",
      date: "2025-03-29",
    },
  ];

  return (
    <>
      <IndexNavbar />

      <div style={pageWrapper}>
        <img
          src="https://images.unsplash.com/photo-1605902711622-cfb43c4437d3"
          alt="background"
          style={backgroundImageStyle}
        />

        <div style={glassCard}>
          <h1 style={titleStyle}>üìã Mes Tickets</h1>

          <div style={ticketListStyle}>
            {tickets.map((ticket) => (
              <div key={ticket.id} style={ticketItemStyle}>
                <div style={ticketHeaderStyle}>
                  <h3 style={{ margin: 0 }}>{ticket.sujet}</h3>
                  <span style={statusStyle(ticket.statut)}>{ticket.statut}</span>
                </div>
                <p style={ticketMetaStyle}>
                  üè¢ {ticket.departement} | üìÖ {ticket.date}
                </p>
                <button style={detailButtonStyle}>üîç D√©tails</button>
              </div>
            ))}
          </div>
        </div>
      </div>

      <Footerr />
    </>
  );
}

// üé® Styles modernes + d√©coration renforc√©e
const pageWrapper = {
  fontFamily: "'Segoe UI', sans-serif",
  minHeight: "100vh",
  position: "relative",
  display: "flex",
  justifyContent: "center",
  alignItems: "center",
  padding: "2rem",
  overflow: "hidden",
};

const backgroundImageStyle = {
  position: "absolute",
  top: 0,
  left: 0,
  width: "100%",
  height: "100%",
  objectFit: "cover",
  filter: "blur(8px) brightness(0.9)",
  zIndex: -1,
};

const glassCard = {
  background: "rgba(255, 255, 255, 0.9)",
  backdropFilter: "blur(10px)",
  borderRadius: "24px",
  padding: "3rem",
  maxWidth: "850px",
  width: "100%",
  boxShadow: "0 12px 30px rgba(0, 0, 0, 0.25)",
};

const titleStyle = {
  fontSize: "2.2rem",
  fontWeight: "800",
  color: "#0d47a1",
  marginBottom: "2.5rem",
  textAlign: "center",
  letterSpacing: "1px",
};

const ticketListStyle = {
  display: "flex",
  flexDirection: "column",
  gap: "1.8rem",
};

const ticketItemStyle = {
  background: "#ffffff",
  padding: "1.5rem",
  borderRadius: "16px",
  borderLeft: "6px solid #0d47a1",
  boxShadow: "0 4px 16px rgba(0, 0, 0, 0.08)",
  transition: "transform 0.2s ease",
  cursor: "pointer",
};

const ticketHeaderStyle = {
  display: "flex",
  justifyContent: "space-between",
  alignItems: "center",
};

const ticketMetaStyle = {
  marginTop: "0.5rem",
  color: "#555",
  fontSize: "0.95rem",
};

const statusStyle = (statut) => {
  let color;
  switch (statut) {
    case "Ouvert":
      color = "#ff9800";
      break;
    case "En cours":
      color = "#2196f3";
      break;
    case "R√©solu":
      color = "#4caf50";
      break;
    default:
      color = "#999";
  }
  return {
    padding: "0.4rem 0.8rem",
    backgroundColor: color,
    color: "#fff",
    borderRadius: "8px",
    fontSize: "0.85rem",
    fontWeight: "600",
    textTransform: "uppercase",
  };
};

const detailButtonStyle = {
  marginTop: "1rem",
  padding: "0.6rem 1.2rem",
  backgroundColor: "#0d47a1",
  color: "#fff",
  border: "none",
  borderRadius: "8px",
  fontWeight: "600",
  fontSize: "0.9rem",
  cursor: "pointer",
  transition: "background 0.3s ease",
};

export default MyTickets;
